import React from "react";
import { ReactNavbar, SearchIconElement, CartIconElement, ProfileIconElement } from "overlay-navbar"; // Import the icon components
import logo from "../../../images/logo.png";

const options = {
  burgerColor: "#F6850E",
  burgerColorHover: "white",
  logo,
  logoWidth: "20vmax",
  navColor1: "rgba(0,0,0,0.4)",
  logoHoverSize: "10px",
  logoHoverColor: "#eb4034",
  link1Text: "Home",
  link2Text: "Products",
  link3Text: "Contact",
  link4Text: "About",
  link1Url: "/",
  link2Url: "/products",
  link3Url: "/contact",
  link4Url: "/about",
  link1Size: "1.3vmax",
  link1Color: "#fae9e5",
  nav1justifyContent: "flex-end",
  nav2justifyContent: "flex-end",
  nav3justifyContent: "flex-start",
  nav4justifyContent: "flex-start",
  link1ColorHover: "#eb4034",
  link1Margin: "1vmax",
  // searchIconUrl: "/search",
  // cartIconUrl: "/cart",
  profileIconUrl: "/login",
  profileIconColor: "#fae9e5",
  searchIconColor: "#fae9e5",
  cartIconColor: "#fae9e5",
  profileIconColorHover: "#eb4034",
  searchIconColorHover: "#eb4034",
  cartIconColorHover: "#eb4034",
  cartIconMargin: "1vmax",
};

const Header = () => {
  return (
    <ReactNavbar {...options}
      // Provide the icon components with their respective URLs
      SearchIconElement={SearchIconElement}
      CartIconElement={CartIconElement}
      ProfileIconElement={ProfileIconElement}
    />
  );
};

export default Header;
